export default {
    name: "SaveTax",
    data: function () {
        return {
            formstate: {},
            temp: null, //for number
            visible: true, //for number
            model: {
                LTF: "0",
                LifeInsurance: "0",
                HealthInsurance: "0",
                Insurances: "0",
                TotalDebt: "0"
            },
            result: {
                MonthlySavings: 0,
                YearlySavings: 0,
                TotalSavings: 0,
                Years: 0
            }
        };
    },
    mounted() { },
    methods: {
        fieldClassName: function (field) {
            if (!field) {
                return "";
            }
            if ((field.$touched || field.$submitted) && field.$valid) {
                return "has-success";
            }
            if ((field.$touched || field.$submitted) && field.$invalid) {
                return "has-danger";
            }
        },
        onSubmit: function () {
            if (this.formstate.$invalid) {
                // alert user and exit early
                return;
            }
            // otherwise submit form
            this.calculator();
        },

        calculator: function () { }
    }
};
